import React from "react";
import queryString from 'query-string';

const Posts = ({match, location}) => {
  queryString.parse(location.search)
  return (
    <div>
      <h1>Posts</h1>
      Year:{match.params.year} , Month:{match.params.month}
    </div>
  );
};

export default Posts;
